  false,\n\t\"url\": null,\n\t\"notes\": \"MoRAP produced and integrated data to map
  and rank wetlands for the Meramec River bottomland in Missouri. LiDAR elevation
  and vegetation height information and air photos were key data sets used for mapping.
  Other data sets, including satellite remote sensing land cover information, National
  Agricultural Statistics Survey (NASS), National Wetlands Inventory (NWI), and Soil
  Survey Geographic Dataset (SSURGO), were also used. MoRAP used algorithms that considered
  size and landscape context to assign ranks for wetland restoration importance.\",\n\t\"owner_org\":
